import React from 'react';

// import { render } from "react-dom"; //https://codesandbox.io/s/zKrK5YLDZ?file=/index.js:139-174
import {Formik, Field, Form, FieldArray, ErrorMessage} from 'formik';

// import * as Yup from 'yup';
// import { EdtitionState } from 'draf-js';
// import { RichEditorExample } from './RichEditor';
// import { Debug } fron '../Debug';


const initialValues = {
  friends: [
    {
      name: '',
      email: '',
    },
  ],
};

const Invitation = () => (
  <div>
  <h1>Invite friends </h1>
  <Formik
    initialValues={initialValues}
    onSubmit={values => {
      setTimeout(() => {
        alert(JSON.stringify(values, null, 2));
      }, 500);
    }}
  >
    {() => <div>foo</div>}
  </Formik>
  </div>
);


export default Invitation;


render(<Invitation />, document.getElementById("root"));
